import React, { useState, useEffect } from 'react';
import { motion } from 'framer-motion';

// Define default values
const BOX_WIDTH = 200;
const BOX_HEIGHT = 200;
const MIN_BOX_WIDTH = 150; // Minimum box width before we reduce the number of circles per row
const MAX_CIRCLES_PER_ROW = 3; // Max number of circles per row

// Random position generation for each circle within the bounding box
function generateRandomPositionInBox(circles, size) {
  let top, left;
  const attempts = 100; // Limit the number of attempts to avoid infinite loop
  let validPosition = false;

  for (let attempt = 0; attempt < attempts; attempt++) {
    top = Math.floor(Math.random() * (BOX_HEIGHT - size));
    left = Math.floor(Math.random() * (BOX_WIDTH - size));

    // Check if the new circle position intersects with any existing circles
    validPosition = !circles.some(circle => {
      const distX = Math.abs(circle.left - left);
      const distY = Math.abs(circle.top - top);
      const combinedRadius = (circle.size + size) / 2;
      return distX < combinedRadius && distY < combinedRadius;
    });

    if (validPosition) break; // Found a valid position

  }

  return { top, left };
}

// Random scale generation for each circle (between 1 and 1.2 for subtle size variations)
function generateRandomScale() {
  return 1 + Math.random() * 0.5; // Random scale between 1 and 1.5
}

// Random wiggle values for animation
function generateRandomWiggle() {
  return Math.random() * 10 - 5; // Random wiggle value between -5 and 5
}

// Updated random size for each circle (between 60px and 160px for more spread)
function generateRandomSize() {
  return Math.floor(Math.random() * (160 - 60 + 1)) + 60; // Random size between 60px and 160px
}

// New function to generate a random animation duration between 6 and 10 seconds
function generateRandomDuration() {
  return 6 + Math.random() * 4; // Random duration between 6 and 10 seconds
}

function PulsatingButton({ text, name, size, position }) {
  const [scale] = useState(generateRandomScale); // Random scale factor
  const [duration] = useState(generateRandomDuration); // Random animation duration

  return (
    <motion.button
      style={{
        position: 'absolute',
        top: position.top,
        left: position.left,
        width: size, // Set circle size
        height: size, // Set circle size
        borderRadius: '50%',
        backgroundColor: '#1A06D0', // Default background color
        color: 'white',
        fontSize: '16px',
        fontWeight: 'bold',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        border: 'none',
        cursor: 'pointer',
        outline: 'none',
      }}
      animate={{
        scale: [1, scale, 1], // Apply random scale factor in animation (subtle)
        x: [0, generateRandomWiggle(), generateRandomWiggle(), generateRandomWiggle(), 0], // Random X wiggles
        y: [0, generateRandomWiggle(), generateRandomWiggle(), generateRandomWiggle(), 0], // Random Y wiggles
      }}
      transition={{
        duration: duration, // Apply random duration for animation
        ease: 'easeInOut',
        repeat: Infinity,
        repeatType: 'loop',
      }}
      whileHover={{
        scale: scale + 0.15, // Increase scale on hover
        transition: { 
          scale: { 
            duration: 0.6, // Slower transition duration when returning to initial size
            ease: 'easeInOut' 
          },
        },
      }}
      onClick={() => alert(`${name} clicked!`)}
    >
      {text}
    </motion.button>
  );
}

const Hero = () => {
  const [circles, setCircles] = useState([]); // Array of circles

  // Function to update the screen width on resize (not used in this case anymore)
  useEffect(() => {
    const handleResize = () => {
      setScreenWidth(window.innerWidth);
    };
    window.addEventListener('resize', handleResize);
    return () => window.removeEventListener('resize', handleResize);
  }, []);

  // Randomly determine how many circles per row between 2 and 4
  const getCirclesPerRow = () => {
    return Math.floor(Math.random() * (4 - 2 + 1)) + 2; // Random number between 2 and 4
  };

  // Function to add one more circle to the page
  const addCircle = () => {
    const circleName = prompt('Name your group', 'Circle ' + (circles.length + 1));
    if (circleName) {
      const randomSize = generateRandomSize();
      const position = generateRandomPositionInBox(circles, randomSize);
      setCircles(prevCircles => [
        ...prevCircles,
        { id: prevCircles.length + 1, name: circleName, size: randomSize, ...position },
      ]);
    }
  };

  return (
    <section style={{ width: '100%', padding: 0, margin: 0 }}>
      <div 
        style={{
          display: 'flex',
          flexWrap: 'wrap',
          justifyContent: 'center',
          gap: 20,
          width: '100%',
        }}
      >
        {circles.map(circle => (
          <div
            key={circle.id}
            style={{
              position: 'relative',
              width: BOX_WIDTH,
              height: BOX_HEIGHT,
              display: 'flex',
              alignItems: 'center',
              justifyContent: 'center',
              margin: 10,
            }}
          >
            <PulsatingButton text={circle.name} name={circle.name} size={circle.size} position={{ top: circle.top, left: circle.left }} />
          </div>
        ))}
      </div>

      <div style={{ display: 'flex', justifyContent: 'center', marginTop: '20px' }}>
        <button
          onClick={addCircle}
          style={{
            padding: '10px 20px',
            fontSize: '16px',
            backgroundColor: '#3498db',
            color: 'white',
            border: 'none',
            borderRadius: '5px',
            cursor: 'pointer',
          }}
        >
          Add Circle
        </button>
      </div>
    </section>
  );
};

const Home = () => {
  return <Hero />;
};

export default Home;
